    geo_json_43ba35ed0df7cdb23196e4c65fd0758e.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["House_No", "Plot_Statu"];
    let aliases = ["Plot Number:", "Status:"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
    ,{"className": "foliumtooltip", "sticky": true});

            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>

    div.innerHTML=table;
    
    return div
    }
